    <div className="flex z-10 fixed backdrop-blur-sm bg-opacity-40 w-full bg-slate-900">
      <header className="top-0 flex h-16 items-center gap-4 px-4 md:px-6">
        <form className="ml-auto flex justify-between space-x-2 items-center">
          <div>test</div>
          <div className="">test</div>
        </form>
      </header>
    </div>
  );
};
